import React from "react";
import { Link } from "react-router-dom";

function ContentList(props) {
  return (
    <div>
      <h5>{props.heading}</h5>
      <ul>
        {props.content.map((text, index) => {
          return (
            <li key={index}>
              <Link>{text}</Link>
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default ContentList;
